import { useState } from 'react';

const App = () => {
  const [myName, setMyName] = useState('thapa technical Subs');

  const changeName = () => {
    let val = myName;

    if (val === 'thapa technical Subs') {
      setMyName('vinod thapa');
    } else {
      setMyName('thapa technical Subs');
    }
  };
  return (
    <>
      <h1>{myName}</h1>
      <button className="btn" onClick={changeName}>
        Click me Plz
      </button>
    </>
  );
};

export default App;
